$(".like_btn").click(function(e){e.preventDefault();var t=$(this),a=$(e.target);"like_btn liked"==t.attr("class")?(t.val("Like"),t.removeClass("liked")):(t.val("Liked"),t.addClass("liked")),$.ajax({type:"POST",url:"{% url 'like_ajax' %}",data:{photo_pk:$(this).attr("data-photo"),csrfmiddlewaretoken:"{{ csrf_token }}"},dataType:"json",success:function(e){a.parents(".photo-item:first").find(".like_count").html(e.viewer_has_liked?e.like_count+" likes":e.like_count+" likes")},error:function(){alert("Sorry, there was an error with your request. Please try again later.")}})});